import React from "react";
import "./roadmap.css";

class Roadmap extends React.Component {
  render() {
    return (
      <div className="section-2">
        <div className="container">
          <div className="row">
            {/* Roadmaps heading */}
            <div className="roadmap-head">
              <h2>Roadmaps</h2>
              <p>Explore and try something new!!</p>
            </div>
            <hr />
            {/* Roadmaps main */}
            <div className="roadmap-main">
              {/* Roadmaps  main heading */}
              <div className="roadmap-main-head">
                <h2>Technologies</h2>
              </div>
              {/* tech-box 4  */}
              <div className="tech-box">
                <div className="techno" id="tech-box-1"><h3>Web development</h3></div>
                <div className="techno" id="tech-box-2"><h3>Android development</h3></div>
                <div className="techno" id="tech-box-3"><h3>Machine Learning</h3></div>
                <div className="techno" id="tech-box-4"><h3>AI and Deep Learning</h3><br><p>Coming Soon...</p></br></div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Roadmap;
